(113, 'widget_custom_html', 'a:5:{i:2;a:2:{s:5:\"title\";s:0:\"\";s:7:\"content\";s:380:\"<p>Shop Bánh Ngon - Siêu thị cung cấp dụng cụ và nguyên liệu làm bánh, các đồ dùng làm bánh.</p>\r\n<div class=\"footer-text\"><span><i class=\"icon icon-Pointer\"></i>Address : TDC, Vo Van Ngan, Thu Duc, HCM.</span><span><i class=\"icon icon-Phone\"></i>Phone : +(84) 123 456 789</span><span><i class=\"icon icon-Mail\"></i>Email : admin@cookietnt.com</span></div>\r\n\";}i:3;a:3:{s:5:\"title\";s:0:\"\";s:7:\"content\";s:1508:\"<div class=\"ht-hero-section fix\">\r\n    <div class=\"ht-hero-slider\">\r\n        <!-- Single Slide Start -->\r\n        <div class=\"ht-single-slide\" style=\"background-image: url(wp-content/themes/cookie-cms/assets/img/slider/8.jpg)\">\r\n            <div class=\"ht-hero-content-one container\">\r\n                <h3>Trái cây tổng hợp</h3>\r\n                <h1 class=\"cssanimation leDoorCloseLeft sequence\">Trái cây tươi</h1>\r\n                <p>Chúng tôi tin rằng ăn uống lành mạnh, không khí trong lành và tính cách nhẹ nhàng là khởi đầu tốt nhất để có được sức khỏe chân chính.</p>\r\n                <a href=\"#\" class=\"default-btn large circle blue hover-blue uppercase\">Shop now</a>\r\n            </div>\r\n        </div>\r\n        <!-- Single Slide End -->\r\n        <!-- Single Slide Start -->\r\n        <div class=\"ht-single-slide\" style=\"background-image: url(wp-content/themes/cookie-cms/assets/img/slider/7.jpg)\">\r\n            <div class=\"ht-hero-content-one container\">\r\n                <h3>Bánh kem tổng hợp</h3>\r\n                <h1 class=\"cssanimation leDoorCloseLeft sequence\">Bánh thơm ngon</h1>\r\n                <p>Chúng tôi tin rằng ăn uống lành mạnh, không khí trong lành và tính cách nhẹ nhàng là khởi đầu tốt nhất để có được sức khỏe chân chính.</p>\r\n                <a href=\"#\" class=\"default-btn\">Shop now</a>\r\n            </div>\r\n        </div>\r\n        <!-- Single Slide End -->\r\n    </div>\r\n</div>\";s:7:\"classes\";s:0:\"\";}i:4;a:3:{s:5:\"title\";s:0:\"\";s:7:\"content\";s:1218:\"<div class=\"organic-about-area pt-90 pb-90\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-6 col-md-6\">\r\n                <div class=\"organic-about-img\">\r\n                    <img src=\"wp-content/themes/cookie-cms/assets/img/banner/about.jpg\" alt=\"\">\r\n                </div>\r\n            </div>\r\n            <div class=\"col-lg-6 col-md-6 align-self-center\">\r\n                <div class=\"organic-about-text\">\r\n                    <div class=\"banner-logo\">\r\n                        <img src=\"wp-content/themes/cookie-cms/assets/img/logo/logo.png\" alt=\"\">\r\n                    </div>\r\n                    <h4>who we are</h4>\r\n                    <p>Duis autem vel eum iriure dolor in hendrerit in vulputate velit esse molestie consequat, vel illum dolore eu feugiat nulla facilisis at vero eros et accumsan t iusto odio dignissim qui blandit praesent luptatum zzril delenit augue duis dolore te feugait nulla facilisi.</p>\r\n                    <div class=\"signature\">\r\n                        <img src=\"wp-content/themes/cookie-cms/assets/img/banner/signature.png\" alt=\"\">\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>\";s:7:\"classes\";s:0:\"\";}i:5;a:2:{s:5:\"title\";s:0:\"\";s:7:\"content\";s:520:\"<div class=\"banner-area-fruits\">\r\n    <div class=\"row no-gutters\">\r\n        <div class=\"col-lg-6 col-sm-6\">\r\n            <div class=\"banner-fruits\">\r\n                <a href=\"#\"><img src=\"wp-content/uploads/2021/03/banner-fruits-1.jpg\" alt=\"\"></a>\r\n            </div>\r\n        </div>\r\n        <div class=\"col-lg-6 col-sm-6\">\r\n            <div class=\"banner-fruits\">\r\n                <a href=\"#\"><img src=\"wp-content/uploads/2021/03/banner-fruits-2.jpg\" alt=\"\"></a>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>\";}s:12:\"_multiwidget\";i:1;}', 'yes'),
